import React from "react";

const LeftSidebar = () =>  {
  return (
    <div className="w-1/4">
      <h2 className="text-xl font-bold text-[#009688] border-b-4 border-[#009688] mb-2">gündemdekiler</h2>
      <ul className="space-y-1 text-sm">
        <li>imamoğlu tutuklandı mı</li>
        <li>müthiş hünkarbeğendi tarifi</li>
        <li>avrupa’ya ihraç edilen portakallarda pestisit bulundu</li>
        <li>ferdi kadıoğlu dünya evine girdi</li>
        <li>fed faiz kararını açıkladı</li>
        <li>havaların bir türlü ısınmaması</li>
      </ul>
    </div>
  );
}

export default LeftSidebar;
